import React from "react";
import "../../data/students";
import students from "../../data/students";

export default (props) => {
  const li1 = (
    <li>
      {students[0].id} - {students[0].nome} - {students[0].value}
    </li>
  );

  const lis = students.map((student)=>{
    return(
        <li>
            {students[0].id} : {students[0].nome} - {students[0].value}
        </li>
    )
  }
  )
  return (
    <div>
      <ul>
        {lis}
      </ul>
    </div>
  );
};
